const client = new ApolloClient({
  uri: 'https://localhost:4000',
  cache: new InMemoryCache()
});


export default async function Valentina (){
    client
    .query({
      query: gql`
query{sessions{
  title
  room
  track
  id
  level
}}
      `
    })
